import React from 'react';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';

import {
    IconButton
} from "@material-ui/core";
import { green } from "@material-ui/core/colors";


import EditIcon from "@material-ui/icons/Edit";

class ReactPopup extends React.Component {

    render() {
        return (<>

            <Popup trigger={<IconButton style={{ color: green[700] }}>
                                <EditIcon />
                            </IconButton>}
                position="center">
                <div>Popup content here !!</div>
                <Box className={classes.InputFields}>
                    <TextField
                        value={firstname}
                        onInput={e => setFirstNameInput(e.target.value)}
                        label="First Name"
                        variant="outlined"
                        className={classes.InputFieldsText}
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <AccountCircleIcon />
                                </InputAdornment>
                            ),
                        }}
                        fullWidth={true}
                    />
                    <TextField
                        value={lastname}
                        onInput={e => setSecondNameInput(e.target.value)}
                        label="Last Name"
                        variant="outlined"
                        className={classes.InputFieldsText}
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <AccountCircleIcon />
                                </InputAdornment>
                            ),
                        }}
                        fullWidth={true}
                    />



                    <TextField
                        value={username}
                        onInput={e => setUserNameInput(e.target.value)}
                        label="UserName"
                        variant="outlined"
                        className={classes.InputFieldsText}
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <AccountCircleIcon />
                                </InputAdornment>
                            ),
                        }}
                        fullWidth={true}
                    />
                    <TextField
                        value={email}
                        onInput={e => setEmailInput(e.target.value)}
                        label="Email"
                        variant="outlined"
                        className={classes.InputFieldsText}
                        InputProps={{
                            startAdornment: (
                                <InputAdornment position="start">
                                    <AlternateEmailIcon />
                                </InputAdornment>
                            ),
                        }}
                        fullWidth={true}
                    />
                </Box>
            </Popup>
        </>)
    };
};

export default ReactPopup;
